INSERT INTO `tblnews` (`newsId`, `news`, `image`, `unitId`) VALUES
(1, 'NCT 127 is the Seoul-based sub-unit of NCT. The number \"127\" refers to the longitudinal coordinate of Seoul, representing the group\'s focus on promoting in the city and beyond. They made their debut in July 2016 with the EP \'NCT #127\', and have since been recognized for their powerful performances and diverse music styles. Over the years, NCT 127 has established a strong presence in the K-pop industry with hits like \'Cherry Bomb\', \'Kick It\', and \'Sticker\'. They are known for their experimental approach to music, often blending genres like hip-hop, R&B, and electronic music.', , 'U1');
INSERT INTO `tblnews` (`newsId`, `news`, `image`, `unitId`) VALUES
(2, 'NCT Dream is the youthful and vibrant sub-unit of NCT, initially comprised of the youngest members. The unit debuted in August 2016 with the single \'Chewing Gum\'. Originally, the concept was that members would \'graduate\' from the unit once they reached adulthood. However, this graduation system was later abolished, allowing NCT Dream to retain its original lineup. The unit is known for its energetic and bright image, with hit songs like \'We Go Up\', \'Boom\', and \'Hot Sauce\'. As they have matured, their music has also evolved, showcasing their growth as artists.', , 'U2');
INSERT INTO `tblnews` (`newsId`, `news`, `image`, `unitId`) VALUES
(3, 'NCT U is the first sub-unit of NCT and operates with a rotational lineup, meaning that the members change depending on the song or concept. The unit debuted in April 2016 with the singles \'The 7th Sense\' and \'Without You\', showcasing a more mature and versatile sound. NCT U allows for a diverse array of musical styles and concepts, as it draws from the larger pool of NCT members. This sub-unit is known for its creative and experimental approach, often highlighting the versatility and range of NCT as a whole.', , 'U3');
INSERT INTO `tblnews` (`newsId`, `news`, `image`, `unitId`) VALUES
(4, 'WayV is the China-based sub-unit of NCT, managed by Label V, a subsidiary of SM Entertainment. The group made their debut in January 2019 with the digital EP \'The Vision\'. They are focused on promoting in the Chinese market and have been praised for their distinct musical style and strong performance skills. WayV has released several successful albums, including \'Take Off\', \'Take Over the Moon\', and \'Awaken the World\'. The unit has a unique blend of NCT\'s musical sensibilities with elements that cater specifically to the Chinese audience, making them a significant force in the C-pop industry.', , 'U4');

